import './App.css';
import Navbar from './Components/Navbar'
import {route,routes} from "react-router-dom";
import HOME from './routes/HOME';

export default function App() {
  return (
    <div className="App">
      <routes>
        <route path="/" element={<HOME/>}/>
      </routes>

      <Navbar />
    </div>
  );
}
